    (item) => <li>{item.name}</li>)}</ul>;
  return (
      <Modal>
     
          {cartItems}
          <div className={classes.total}>
          <span>amount</span>
          <span >36.88</span>
          </div>
          <div className={classes.actions}>
              <button className={classes['button--alt']}>Close</button>
              <button className={classes.button}>Order</button>
              </div>

     
      </Modal>
  )
};
export default Cart;
